var getTestRom = (function() {
  var roms = {
'croom':'',
'lj65':''
}
  return function(romName) {
    var rom = roms[romName];
    // Requires base64.js
    if (typeof atob === 'undefined') {
      return Base64.decode(rom);
    }
    else {
      return atob(rom);
    }
  };
})();